    }
    render () {
        return (
        <div>
            <h1>Radio</h1>
            <ReactHowler
            src='http://jazzradio.ice.infomaniak.ch/jazzradio-high.mp3'
            playing={true}
            html={true}
            />
        </div>
        )
      }
}

export default Radio
